// if offline show a page
self.addEventListener('fetch', (event) => {
  log('fetch', self.navigator.onLine ? 'online' : 'offline', event);
  if (!self.navigator.onLine) {
    event.respondWith(
      Promise.resolve(
        new Response(html, {
          status: 200,
          statusText: 'Offline',
          headers: {
            'Content-Type': 'text/html',
            'Cache-control': 'private, max-age=0, no-cache',
          },
        }),
      ),
    );
  }
});

// take over old sw

self.addEventListener('install', (event) => {
  log('CacheName', _cacheName, 'Scope', _scope);
  log('installed', event);
  self.skipWaiting();
});

// delete old caches, take over clients
self.addEventListener('activate', (event) => {
  log('CacheName', _cacheName, 'Scope', _scope);
  log('activated', event);
  event.waitUntil(
    self.registration.update().then((event2) => {
      log('updated', event2);
      return caches
        .keys()
        .then((cacheNames) =>
          Promise.all(
            cacheNames.map((cacheName) => {
              if (cacheName !== _cacheName) {
                log('Deleting old cache:', cacheName);
                return caches.delete(cacheName);
              }
            }),
          ),
        )
        .then(() => self.clients.claim());
    }),
  );
});
